import './App.css';
import {Wallet} from './Wallet';
import "./Firebase";
import { useWallet } from "@solana/wallet-adapter-react";
import { SendData,CheckData} from './Firebase';
async function send(username: string,password: string)
{
  const data = await CheckData(username);
  if(data !== "No data available")
  {
    console.log("Return");
    return;
  }
  await SendData(username,password);
}
function Address()
{
  const {publicKey} = useWallet();
  var address = useWallet().publicKey?.toBase58();
  console.log("address-->"+address);

}
function App() {

  return (
    <div className="App">
      <div className="content">
        <div>
          <button onClick = {()=> send("Shub","334")}>
            Send Data
          </button>
          <button onClick = {Address}>
            Address
          </button>
          <p>
            {}
          </p>
        </div>
        <Wallet />
      </div>
    </div>
  );
}

export default App;
